工具不要のワンタッチで脱着可能な  「Ezyシステム」  ペダルです。<br>輪行の際にペダルスパナを持ち歩く必要が無く、便利です。<br>収納袋付属で、外したペダルを入れておくことが出来ます。<br><br><table  width="600" border="1" cellpadding="1" cellspacing="1">  <tr>    <td colspan="2" bgcolor="#cccccc"><strong>スペック</strong> </td>  </tr>  <tr>    <td width="300">サイズ</td>    <td width="300">L69×W100×T29mm</td>  </tr>  <tr>    <td>材質</td>    <td>アルミ</td>  </tr>  <tr>    <td>平均重量</td>    <td>340g</td>  </tr></table><br><table width="600" border="0" cellpadding="0" cellspacing="0">  <tr>    <td>※通常のペダルレンチでは厚みが大きすぎて取付できません。取付は薄い15mmのハブスパナを使用してください。</td>  </tr></table><br /><table width="600" border="0" cellpadding="0" cellspacing="0">  <tr>    <td>※商品のカラーはディスプレイの種類等により、実物と異なって見える場合がございます。<br />    掲載商品の仕様、ロゴ等のデザインは改良の為、変更される場合がある事をご了承下さい。</td>  </tr></table><img src="http://image.rakuten.co.jp/mapsports-syuppin/cabinet/top/about-attention640.jpg" border="0"><br><table width="640" bgcolor="#dad7d2"><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>完成車の場合は組上げ作業の関係により、発送は商品入荷日から最長で約1週間～10日後となります。<br>予めご了承ください。</b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>当店に掲載されている商品は、当店在庫、及びメーカー在庫をもとに運営しております。<br>商品ページの在庫状況はリアルタイムの更新ではない為、ご注文が可能な状態であっても売り切れになってしまう可能性がございます。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>メーカーおよび代理店にて完売または納期未定となってしまった場合は、その旨をご連絡の上、誠に申し訳ございませんが、ご注文を変更またはキャンセルのご対応とさせていただいております。<br></b></font></td></tr><tr valign="top"><td><font color="#9b8e85" size="2"><b><font size="-1">◆</font></b></font></td><td><font color="#9b8e85" size="2"><b>ご注文後/発送後キャンセル・交換・返品等は基本的には出来かねます。<br>お客様ご都合での返品・交換を強くご希望される場合に関しましては、ご購入金額の約30％相当の金額での、買取(買い戻し)のみのご対応とさせていただいております。<br>サイズや互換性など少しでもご不明な点がございましたら、些細な事でもお気軽にお問い合わせ下さい。</b></font></td></tr>
